        <h1 className="w-full text-3xl font-bold text-[white] m-4">carbono</h1>
        <ul className="uppercase p-4">
          <li className="p-4 text-white border-b border-gray-100">Home</li>
          <li className="p-4 text-white border-b border-gray-100">About</li>
          <li className="p-4 text-white border-gray-100">Contact</li>
        </ul>
      </div>
    </div>
  );
}

export default Navbar
